/**
 * 地区联动
 * */
function getProvinceBuy(){
    //$('html, body').animate({scrollTop:0}, 'slow');
    getscroll();
    $("body .dqld_div").remove();
	var province=eval(proStr);
	var newStr=new Array();
	newStr.push("<div class=\"dqld_div\" style=\"\"><ul>");
	//循环省级列表
	for(var i=0,psize=province.length;i<psize;i++){
		province[i].NAME;
		newStr.push("<li onclick=\"getCityBuy("+i+")\">"+province[i].NAME+"</li>");
	}
	newStr.push("</ul></div>");
	$("body").append(newStr.join(""));
}

function getCityBuy(val){
    getscroll();
    //$('html, body').animate({scrollTop:0}, 'slow');
	var province=eval(proStr);
	var city=eval(province[val].ITEMS);
	var citys=eval(province[val]);
//	console.log(citys.NAME);
	citysize=citys.NAME.length;
	zxs=citys.NAME.substr(citysize-1,citysize);
	var newStr=new Array();
	newStr.push("<div class=\"dqld_div\"><ul>");
	//插入已选省份
	newStr.push("<li onclick=\"getProvinceBuy()\" style=\"background-color:#dd403b;\">"+province[val].NAME+"</li>");
	if(zxs=="市"){
		newStr.push("</ul></div>");
		$("body .dqld_div").remove();
		$("body").append(newStr.join(""));
		getallAreass(val);
	}else{

		//循环市级列表
		for(var j=0,csize=city.length;j<csize;j++){
			if(city[j].NAME=="市辖区"||city[j].NAME=="县"){
				newStr.push("<li onclick=\"getAreaBuy("+j+","+val+")\"  style=\"padding-left:20px;\">"+city[j].NAME+"</li>");
			}else{
				newStr.push("<li onclick=\"getallAreas("+j+","+val+")\"  style=\"padding-left:20px;\">"+city[j].NAME+"</li>");
			}	
		}
		newStr.push("</ul></div>");
		$("body .dqld_div").remove();
		$("body").append(newStr.join(""));
	}
	
}

function getAreaBuy(val,val1){
	//val市级的序列号         val1省级的序列号
    getscroll();
    //$('html, body').animate({scrollTop:0}, 'slow');
    pcid = getCookie("pcVal");
    container = getCookie("container");
	var province=eval(proStr);
	var city=eval(province[val1].ITEMS);
	var area=eval(city[val].ITEMS);
	
	var newStr=new Array();
	newStr.push("<div class=\"dqld_div\"><ul>");
	newStr.push("<li onclick=\"getProvinceBuy()\" style=\"background-color:#dd403b;\">"+province[val1].NAME+"</li>");
	newStr.push("<li onclick=\"getCityBuy("+val1+")\" style=\"background-color:rgba(221,64,59,0.8);padding-left:10px;\">"+city[val].NAME+"</li>");
	for(var t=0,asize=area.length;t<asize;t++){
		area[t].NAME;
		newStr.push("<li  style=\"padding-left:25px;\" onclick=\"getallAreas("+val1+","+val+","+t+")\">"+area[t].NAME+"</li>");
	}
	newStr.push("</ul></div>");
	if(asize==0){
		var allarea=province[val1].NAME+city[val].NAME;
		$("#"+pcid).attr({"SS":province[val1].NAME,"SQ":city[val].NAME,"XS":""});
		$("#"+pcid).html(allarea);
		$("body .dqld_div").remove();
        $('.'+container).show();

        removeCookie("pcVal");
        removeCookie("container");
	}
	else{
		$("body .dqld_div").remove();
		$("body").append(newStr.join(""));
	}
}

function getallAreass(val){
    getscroll();
    //$('html, body').animate({scrollTop:0}, 'slow');
    pcid = getCookie("pcVal");
    container = getCookie("container");
	var province=eval(proStr);
	var city=eval(province[val].ITEMS);
//	var area=eval(city[val1].ITEMS);
	var allarea=province[val].NAME;
	$("#"+pcid).attr({"SS":province[val].NAME,"vl":city[0].ID});
	$("#"+pcid).html(allarea);
	
	$("body .dqld_div").remove();
    //$('.'+container).show();
    $('.container').show();

    removeCookie("pcVal");
    removeCookie("container");
}

function getallArea(val,val1,val2){
    getscroll();
    //$('html, body').animate({scrollTop:0}, 'slow');
    pcid = getCookie("pcVal");
    container = getCookie("container");
	var province=eval(proStr);
	var city=eval(province[val].ITEMS);
	var area=eval(city[val1].ITEMS);
	var allarea=province[val].NAME+'-'+area[val2].NAME;
	$("#"+pcid).attr({"SS":province[val].NAME,"SQ":city[val1].NAME,"XS":area[val2].NAME,"vl":area[val2].ID});
	$("#"+pcid).html(allarea);
	
	$("body .dqld_div").remove();
    //$('.'+container).show();
    $('.container').show();

    removeCookie("pcVal");
    removeCookie("container");
}

function getallAreas(val,val1){
    getscroll();
    //$('html, body').animate({scrollTop:0}, 'slow');
    pcid = getCookie("pcVal");
    container = getCookie("container");
	var province=eval(proStr);
	var city=eval(province[val1].ITEMS);
	var area=eval(city[val].ITEMS);
	var allarea=province[val1].NAME+'-'+city[val].NAME;
	$("#"+pcid).attr({"SS":province[val1].NAME,"SQ":city[val].NAME,"vl":city[val].ID});
	$("#"+pcid).html(allarea);
	
	$("body .dqld_div").remove();
    //$('.'+container).show();
    $('.container').show();

    removeCookie("pcVal");
    removeCookie("container");
}

